		row1l = Sse2.Add(Sse2.Add(row1l, b0), row2l);
		row1h = Sse2.Add(Sse2.Add(row1h, b1), row2h);

		row4l = Sse2.Xor(row4l, row1l);
		row4h = Sse2.Xor(row4h, row1h);

		row4l = Sse2.Shuffle(row4l.AsUInt32(), 0b_10_11_00_01).AsUInt64();
