		r24 = Vector128.Create((byte)3, 4, 5, 6, 7, 0, 1, 2, 11, 12, 13, 14, 15, 8, 9, 10);
		row2l = Ssse3.Shuffle(row2l.AsByte(), r24).AsUInt64();
		row2h = Ssse3.Shuffle(row2h.AsByte(), r24).AsUInt64();

